import React, { Fragment } from "react";

const Footer = () => {
  return (
    <div>
      <Fragment>
        <footer className="py-1">
          <p className="text-center mt-1">
            Ecommerce Amazon - 2023-2025, All Rights Reserved
          </p>
        </footer>
      </Fragment>
    </div>
  );
};

export default Footer;
